import './App.css';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

import React, { useEffect, useState } from "react"; 
import axios from "axios"

import HomeScreen from "./screen/HomeScreen"
import ItemDetail from "./screen/ItemDetailScreen"
import ItemBuy from "./screen/ItemBuyScreen"
import Menu from "./container/MenuContainer"
import { Provider } from "react-redux";
import CartStore from "./redux/cart/CartStore"
import ItemStore from './redux/items/ItemStore';


axios.defaults.baseURL = "http://127.0.0.1:3000"
axios.defaults.headers = {
    'Content-Type': 'application/json;charset=UTF-8',
    'Access-Control-Allow-Origin': '*'
}

function App() {

  const [MenuOfWoMen,setListWoment] = useState([]);
  const [MenuOfMen,setListMen] = useState([]);


  useEffect(() => {
    axios.get("/menu")
         .then(res => {
           let menu = res.data;
           setListMen(Object.entries(menu.listMenuOfMen));
           setListWoment(Object.entries(menu.listMenuOfWoMen))
         })
         .catch(err => console.log(err))
  },[60])

  return(
    <div className="p-0 m-0">
        <Router>
            <Provider store={CartStore}>
              <Menu MenuOfWoMen={MenuOfWoMen} MenuOfMen={MenuOfMen} className="m-0"/>
            </Provider>
            <Switch>
                <Provider store={ItemStore}>
                  <Route path="/" exact component={HomeScreen} />

                  <Route path="/details" component={ItemDetail} />

                  <Route path="/collections/:anotherName" component={ItemBuy} />
                </Provider>
            </Switch>
        </Router>
    </div>
  );
}

export default App;
